import React, { Fragment } from "react";

//const array = ["carlos", "kendall", "ariel", "Jonathan"];

const arrayOBJ = [
  {
    id: 1,
    nombre: "Carlos",
    apellido: "Rivera",
  },

  {
    id: 2,
    nombre: "Kendall",
    apellido: "Ocampo",
  },

  {
    id: 3,
    nombre: "Ariel",
    apellido: "Gaitan",
  },
];

const P = () => {
  return (
    <Fragment>
      <h2>
        {arrayOBJ.map((el) => (
          <p key={el.id}>{el.apellido}</p>
        ))}
      </h2>
    </Fragment>
  );
};

export default P;
